import styled from "@emotion/styled";

function App() {
  return (
    <Layout>
      <Container></Container>
    </Layout>
  );
}

export default App;

const Layout = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`;

const Container = styled.div`
  width: 380px;
  height: 100vh;
  background-color: aliceblue;
`;
